import Mobile from "./Mobile";
import React from 'react'
import Mobiles from './Mobiles.json';
const MobileLists = () => {

  return (
    <div>
      {Mobiles.map((ele) =>
      <Mobile image={ele.image} 
       title={ele.title} 
       brand={ele.brand} 
       price={ele.price} />
      
      )}
     
    </div>
  )
}

export default MobileLists
